class Node
{
  var $id;
  var $name;
  var $type;
  var $type_index;
  var $chr;
  var $bp;
  var $associations = array();

  function __construct($id1, $name1, $type1, $type_index1, $chr1, $bp1)
  {
    $this->id = $id1;
    $this->name = $name1;
    $this->type = $type1;
    $this->type_index = $type_index1;
    $this->chr = $chr1;
    $this->bp = $bp1;
  }
}

class Association
{
  var $id;
  var $pval;
  var $cis;

  function __construct($id1, $pval1, $cis1)
  {
    $this->id = $id1;
    $this->pval = $pval1;
    $this->cis = $cis1;
  }
}

function id_in_node_array($id, $node_array)
{
  $count = count($node_array);
  for($i = 0; $i < $count; $i++){
    if($id == $node_array[$i]->id){
      return true;
    }
  }
  return false;
}

function is_cis($type1, $type2, $chr1, $chr2, $bp1, $bp2, $cis_cutoff)
{
  if($type1 == "T" || $type2 == "T" || $type1 == "P" || $type2 == "P"){
    return false;
  }
  if($chr1 != $chr2){
    return false;
  }
  if(abs($bp1 - $bp2) > $cis_cutoff){
    return false;
  }
  return true;
}

