  			"P" => "#FFFF00",
  			"S" => "#00FF00"	);
  $node_shapes = array(
  			"M" => "square",
  			"E" => "circle",
  			"T" => "star",
			"B" => "star",
  			"P" => "circle",
  			"S" => "triangle"	);
  
  $edge_pval_ratio = 6;	// divide by this number to get the lineWidth
  $edge_colors = array(
  			"normal" => "#00FF00",
  			"cis" => "#FF0000",
  			"same_cis" => "#0000FF"	);
  
  $json = "[";
  $first_node = true;
  foreach($nodes as $node){
    $node_size = 5;
    if(in_array($node->id, $first_nodes)){
      $node_size = 20;
    }
    if($first_node){
      $first_node = false;
    }
    else{
      $json .= ",";
    }
  
    // id
    $json .= "{\"id\":\"" . $node->id . "\",";	// for vim editing --> }
    // name
    $node_name = "";
    if($node->type == "M"){
      $node_name = "CG-" . $node->chr . ":" . $node->bp;
    }
    elseif($node->type == "S"){
      $node_name = "SNP-" . $node->chr . ":" . $node->bp;
    }
    else{
      $node_name = $node->name;
    }
    $json .= "\"name\":\"" . $node_name . "\",";
    // data
    $node_type = $node->type;
    if($node_type == "T" && $node->type_index > 60){	// for metabolites
      $node_type = "B";
    }
    $json .= "\"data\":{\"\$color\":\"" . $node_colors[$node_type] . "\",\"\$type\":\"" . $node_shapes[$node_type] . "\",\"\$dim\":" . $node_size . "},";
  
    // adjacencies
    $json .= "\"adjacencies\":[";
    $first_edge = true;
    foreach($node->associations as $adjacency){
      $edge_color = "";
      $line_width = 0;
      if($adjacency->cis){
        if($adjacency->pval == -1){	// same cis adjacency
          $edge_color = $edge_colors["same_cis"];
          $line_width = 1;
        }
        else{	// normal cis adjacency
          $edge_color = $edge_colors["cis"];
          $line_width = $adjacency->pval / $edge_pval_ratio;
        }
      }
      else{	// not cis
        $edge_color = $edge_colors["normal"];
        $line_width = $adjacency->pval / $edge_pval_ratio;
      }
      if($first_edge){
        $first_edge = false;
      }
      else{
        $json .= ",";
      }
      $json .= "{\"nodeTo\":\"" . $adjacency->id . "\",";
      //data
      $json .= "\"data\":{\"\$color\":\"" . $edge_color . "\",\"\$lineWidth\":" . $line_width . "}}";
    }
    $json .= "]}";
  }
  $json .= "]";

mysqli_close($link);
echo "<script language=\"javascript\" type=\"text/javascript\">var json = $json;</script>";
}

